const xapi = require('xapi');

/*
  Some XAPI commands accept multiline data as inputs for allowing posting of large content data.
  Examples of this is XML definition files for in-room controls, adding macros, applying custom imagery for Branding and
  applying security certificates.
  The syntax for this is to send the content as the last attribute to the command (Note, some content may need to be base64 formatted first)
  Also: Correct JavaScript syntax for text that wrap over multiple lines is using backticks (``) to enclose content.
*/

// this example will upload a custom in-room control panel to the codec that will appear on the touch 10 or DX70/80 home screen
xapi.command('UserInterface Extensions Panel Save', {PanelId:'multiline_demo'},   
`
<Extensions>
  <Version>1.5</Version>
  <Panel>
    <Type>Home</Type>
    <Icon>Webex</Icon>
    <Order>1</Order>
    <Color>#30D557</Color>
    <Name>MultiLine Demo</Name>
  </Panel>
</Extensions>
`);



